        {
            "imports": {
                "three": "https://unpkg.com/three@0.159.0/build/three.module.js",

    <script type="module">

        import { GLTFLoader } from 'three/addons/loaders/GLTFLoader.js';
        import { RGBELoader } from 'three/addons/loaders/RGBELoader.js';
        import { OrbitControls } from 'three/addons/controls/OrbitControls.js';

        // Set up the scene, camera, and renderer
        const scene = new THREE.Scene();
        const camera = new THREE.PerspectiveCamera(75, window.innerWidth / window.innerHeight, 0.1, 1000);
        const renderer = new THREE.WebGLRenderer({ antialias: true });
        renderer.setSize(window.innerWidth, window.innerHeight);
        renderer.toneMapping = THREE.ACESFilmicToneMapping;
        renderer.toneMappingExposure = 1;
        renderer.outputEncoding = THREE.sRGBEncoding;
        document.body.appendChild(renderer.domElement);

        // Set up OrbitControls
        const controls = new OrbitControls(camera, renderer.domElement);
        controls.enableDamping = true;
        controls.dampingFactor = 0.05;
        controls.screenSpacePanning = true;
        controls.panSpeed = 0.5;
        controls.minDistance = 3;
        controls.maxDistance = 20;
        controls.maxPolarAngle = Math.PI;

        // Default camera position and target
        const defaultCameraPosition = new THREE.Vector3(-3, 2, 3);
        const defaultTarget = new THREE.Vector3(0, 0, 0);

        // Auto-reset variables
        let lastInteractionTime = Date.now();
        const resetDelay = 3000; // 3 seconds
        let isResetting = false;
        let resetAnimationFrame = null;

        // Mouse button hold detection
        const mouseButtonState = {
            left: false,
            right: false

        // Load HDR environment map
        new RGBELoader()
            .setPath('https://threejs.org/examples/textures/equirectangular/')
            .load('royal_esplanade_1k.hdr', function(texture) {
                texture.mapping = THREE.EquirectangularReflectionMapping;
                scene.background = texture;
                scene.environment = texture;
                loadModel();
            });

        // Lighting setup
        const ambientLight = new THREE.AmbientLight(0xffffff, 0.5);
        scene.add(ambientLight);

        const directionalLight = new THREE.DirectionalLight(0xffffff, 1);
        directionalLight.position.set(5, 5, 5);
        scene.add(directionalLight);

        // Set initial camera position
        camera.position.copy(defaultCameraPosition);
        controls.target.copy(defaultTarget);
        controls.update();

A8wD6AOAA3QDbAOAA2wDiAOIA2wDMAOIAzADEAMQAzADOAMQAzgDIAL8AwwD8AL8A/AD9AMMAwQD+AMMA/gD8ANUA0wD/ANUA/wAAAdEA1QAAAdEAAAEBAdMAvwD9ANMA/QD/ANgA2gACAdgAAgEEAeUA5wAFAeUABQEGAecA1wADAecAAwEFAcEA5QAGAcEABgH+ANoA0QABAdoAAQECAcAA0ADZAMAA2QDkAMIAvgDSAMIA0gDUAMAAwgDUAMAA1ADQADwAOgA4ADwAOAA2AA=='; // Replace with your actual base64 string
            const modelUrl = 'data:application/octet-stream;base64,' + base64Model;
            
            loader.load(modelUrl, 
                (gltf) => {
                    const model = gltf.scene;
                    scene.add(model);

                    // Calculate bounding box
                    const box = new THREE.Box3().setFromObject(model);
                    const size = box.getSize(new THREE.Vector3());
                    const center = box.getCenter(new THREE.Vector3());

                    // Adjust model scale and position
                    const maxDim = Math.max(size.x, size.y, size.z);
                    const scale = 5 / maxDim; // Scale to fit within a 5x5x5 cube
                    model.scale.multiplyScalar(scale);
                    model.position.sub(center.multiplyScalar(scale)); // Center the model

                    // Update controls target to center of model
                    defaultTarget.copy(model.position);
                    controls.target.copy(defaultTarget);
                    controls.update();
                },
                null,
                (error) => {
                    console.error('An error occurred while loading the model:', error);
                }
            );

        // Update last interaction time and cancel reset if in progress
        function updateInteractionTime() {
            lastInteractionTime = Date.now();
            if (isResetting) {
                cancelReset();
            }
        }

        // Cancel the ongoing reset animation
        function cancelReset() {
            if (resetAnimationFrame) {
                cancelAnimationFrame(resetAnimationFrame);
                resetAnimationFrame = null;
            }
            isResetting = false;
        }

        // Function to handle mouse button press
        function onMouseDown(event) {
            event.preventDefault();
            updateInteractionTime();
            if (event.button === 0) {
                mouseButtonState.left = true;
            } else if (event.button === 2) {
                mouseButtonState.right = true;
            }
        }

        // Function to handle mouse button release
        function onMouseUp(event) {
            if (event.button === 0) {
                mouseButtonState.left = false;
            } else if (event.button === 2) {
                mouseButtonState.right = false;
            }
        }

        // Function to check if buttons are being held and update interaction time
        function checkButtonHoldAndUpdateInteraction() {
            if (mouseButtonState.left || mouseButtonState.right) {
                updateInteractionTime();
            }
        }

        // Add event listeners for user interaction
        renderer.domElement.addEventListener('mousedown', onMouseDown);
        renderer.domElement.addEventListener('mouseup', onMouseUp);
        renderer.domElement.addEventListener('contextmenu', (event) => event.preventDefault());
        renderer.domElement.addEventListener('wheel', updateInteractionTime);
        renderer.domElement.addEventListener('touchstart', updateInteractionTime);

        // Smooth step function for easing
        function smoothstep(x) {
            return x * x * (3 - 2 * x);
        }

        // Reset camera position
        function resetCamera() {
            isResetting = true;
            const resetDuration = 2000; // 2 seconds
            const startTime = Date.now();
            const startPosition = camera.position.clone();
            const startTarget = controls.target.clone();

            function animateReset() {
                const elapsedTime = Date.now() - startTime;
                const rawProgress = Math.min(elapsedTime / resetDuration, 1);
                const progress = smoothstep(rawProgress); // Apply easing

                camera.position.lerpVectors(startPosition, defaultCameraPosition, progress);
                controls.target.lerpVectors(startTarget, defaultTarget, progress);
                controls.update();

                if (rawProgress < 1 && isResetting) {
                    resetAnimationFrame = requestAnimationFrame(animateReset);
                } else {
                    isResetting = false;
                    resetAnimationFrame = null;
                }
            }

            resetAnimationFrame = requestAnimationFrame(animateReset);
        }

        // Animation loop
        function animate() {
            requestAnimationFrame(animate);

            checkButtonHoldAndUpdateInteraction();

            // Check if it's time to reset the camera
            if (!isResetting && Date.now() - lastInteractionTime > resetDelay) {
                resetCamera();
            }

            controls.update();
            renderer.render(scene, camera);
        }

        // Handle window resizing
        window.addEventListener('resize', onWindowResize, false);

        function onWindowResize() {
            camera.aspect = window.innerWidth / window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        }

        animate();
    </script>
